import React, { useState,useEffect } from 'react'
import axios from 'axios'

export default function Profile() {

    const [user,setUser] = useState("None")

        useEffect(()=>{
            axios
            .get("http://localhost:8080/getall")
            .then((res)=>setUser(res.data));
        },[user]);

  return (
    <>
        <h1>{user}</h1>
    </>
  )
}
